-- ----------------------------
DROP TABLE IF EXISTS `supplier_bak`;
CREATE TABLE `supplier_bak` (
`supplier_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
`user_id` int(10) DEFAULT '0' COMMENT '供应商对应用户ID（服务商客户上传产品使用）',
`supplier_companyname` char(50) DEFAULT NULL,
`supplier_ceo` char(25) DEFAULT NULL COMMENT '公司负责人',
`supplier_ceo_mobile` char(25) DEFAULT NULL COMMENT '公司负责人手机',
`supplier_name` char(25) NOT NULL,
`supplier_nickname` char(25) DEFAULT NULL,
`service_id` int(10) DEFAULT '0' COMMENT '客服ID',
`supplier_grade` int(10) DEFAULT '10' COMMENT '等级(默认10)',
`supplier_gradename` char(10) DEFAULT NULL,
`supplier_score` int(10) DEFAULT '0' COMMENT '积分',
`supplier_sumscore` int(10) DEFAULT '0',
`supplier_payable_money` decimal(10,2) DEFAULT '0.00' COMMENT '应交保证金',
`supplier_deposit_money` decimal(10,2) DEFAULT '0.00' COMMENT '供应商已交保证金',
`supplier_deposit_rate` decimal(10,2) DEFAULT '0.00' COMMENT '提现扣保证金',
`service_payable_money` decimal(10,2) DEFAULT '0.00' COMMENT '应交服务费',
`service_deposit_money` decimal(10,2) DEFAULT '0.00' COMMENT '已交服务费',
`service_deposit_rate` decimal(10,2) DEFAULT '0.00' COMMENT '提现扣服务费占比',
`supplier_total_money` decimal(10,2) DEFAULT '0.00' COMMENT '总收入金额',
`supplier_refund_money` decimal(10,2) DEFAULT '0.00' COMMENT '累计退款金额',
`supplier_sales_money` decimal(10,2) DEFAULT '0.00' COMMENT '累计销售额',
`supplier_money` decimal(10,2) DEFAULT '0.00' COMMENT '余额',
`supplier_product` int(10) DEFAULT '0',
`supplier_order` int(10) DEFAULT '0' COMMENT '订单量',
`supplier_email` char(50) DEFAULT NULL COMMENT '用户名/邮箱/登录',
`supplier_login_id` char(30) DEFAULT NULL,
`supplier_pwd` char(50) NOT NULL,
`supplier_photo` char(100) DEFAULT NULL COMMENT '头像',
`supplier_mobile` char(25) DEFAULT NULL,
`supplier_tel` char(25) DEFAULT NULL,
`supplier_fax` char(25) DEFAULT NULL,
`supplier_qq` char(25) DEFAULT NULL,
`supplier_weixin` char(25) DEFAULT NULL,
`supplier_emails` char(50) DEFAULT NULL,
`supplier_province` int(10) DEFAULT NULL,
`supplier_city` int(10) DEFAULT NULL,
`supplier_county` int(10) DEFAULT NULL,
`supplier_address` text,
`shop_address` char(50) DEFAULT NULL COMMENT '门市地址',
`trade_product` char(50) DEFAULT NULL COMMENT '主要产品',
`trade_brand` char(100) DEFAULT NULL COMMENT '主营品牌',
`brand_logo` varchar(200) DEFAULT '0' COMMENT '品牌id',
`brand_id` int(10) DEFAULT NULL,
`trade_space` char(100) DEFAULT '',
`trade_type` char(100) DEFAULT '',
`trade_style` char(100) DEFAULT '',
`bank_name` char(20) DEFAULT NULL COMMENT '开户行',
`bank_username` char(25) DEFAULT NULL COMMENT '开户人姓名',
`bank_id` char(25) DEFAULT '' COMMENT '银行帐号',
`pc_detail_template` text COMMENT '供应商Diy商品详情模板',
`supplier_content` varchar(1000) DEFAULT NULL,
`is_encashment` int(1) DEFAULT '1' COMMENT '是否能提现:1=正常能提现,0=关闭提现',
`supplier_status` int(1) NOT NULL DEFAULT '1' COMMENT '状态:0=审核/1=正常/2=离职/3=关闭/锁定',
`supplier_login_time` int(10) DEFAULT NULL,
`supplier_sales_time` int(10) DEFAULT '0' COMMENT '最后一次出售产品',
`supplier_update_time` int(10) DEFAULT '0' COMMENT '最后操作时间',
`supplier_create_time` int(10) DEFAULT '0' COMMENT '创建时间',
`fw_relevance` text NOT NULL COMMENT '绑定客人消息',
`is_save_price` int(2) DEFAULT '0' COMMENT '是否可修改产品价格',
`supplier_total_return_money` decimal(10,2) NOT NULL COMMENT '累计结算金额',
`supplier_return_money` decimal(10,2) NOT NULL COMMENT '剩余结算金额',
`is_self_support` tinyint(1) DEFAULT '1' COMMENT '是否自营1:是，0:否',
`supplier_return_nam` varchar(255) DEFAULT NULL COMMENT '财务姓名',
`supplier_return_id` int(11) DEFAULT '0' COMMENT '财务收款微信',
`store_id` int(10) DEFAULT '0' COMMENT '关联商城uid',
`is_on_line` tinyint(1) DEFAULT '0',
`supplier_end_time` int(11) DEFAULT NULL COMMENT '到期时间',
`is_recommend` tinyint(1) DEFAULT '0' COMMENT '1',
`is_open_store` tinyint(1) DEFAULT '0' COMMENT '1',
`cate_ids` varchar(100) DEFAULT NULL COMMENT '分类ids',
`store_account_ids` varchar(100) DEFAULT NULL COMMENT '多账号user_id',
PRIMARY KEY (`supplier_id`),
KEY `service_id` (`service_id`),
KEY `supplier_id` (`supplier_id`),
KEY `supplier_name` (`supplier_name`),
KEY `supplier_companyname` (`supplier_companyname`),
KEY `supplier_mobile` (`supplier_mobile`)
) ENGINE=MyISAM AUTO_INCREMENT=100502 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='供应商表';

